import React from 'react';
import { Card, Typography, List, ListItem, ListItemIcon, ListItemText, Divider, Box, Chip } from '@mui/material';
import {
  MedicalServices,
  Warning,
  CheckCircle,
  Info,
  LocalHospital,
  MonitorHeart,
  Psychology,
  FitnessCenter,
  Restaurant,
  Spa
} from '@mui/icons-material';

const MedicalHistoryAnalysis = ({ analysis }) => {
  if (!analysis) return null;

  // Helper function to parse sections from the analysis text
  const parseSection = (text, sectionNumber) => {
    if (!text) return null;

    // Remove any leading/trailing whitespace and newlines
    text = text.trim();

    // Match the section including its content up to the next section or end of text
    const regex = new RegExp(`${sectionNumber}\\. ([^:]+):([\\s\\S]*?)(?=\\d+\\.|$)`, 'i');
    const match = text.match(regex);

    if (!match) return null;
    return match[2].trim();
  };

  // Extract sections from the analysis text
  const analysisText = analysis?.analysis || '';

  // Define sections with their content
  const sections = [
    {
      title: 'Differential Diagnosis',
      icon: <Warning color="error" />,
      content: parseSection(analysisText, '1')
    },
    {
      title: 'Risk Assessment',
      icon: <LocalHospital color="primary" />,
      content: parseSection(analysisText, '2')
    },
    {
      title: 'Recommended Tests',
      icon: <MonitorHeart color="secondary" />,
      content: parseSection(analysisText, '3')
    },
    {
      title: 'Treatment Considerations',
      icon: <CheckCircle color="success" />,
      content: parseSection(analysisText, '4')
    }
  ];

  // Define lifestyle sections with direct access to recommendations
  const lifestyleSections = [
    {
      title: 'Diet Recommendations',
      icon: <Restaurant color="primary" />,
      content: analysis?.recommendations?.diet
    },
    {
      title: 'Exercise Guidelines',
      icon: <FitnessCenter color="secondary" />,
      content: analysis?.recommendations?.exercise
    },
    {
      title: 'Stress Management',
      icon: <Spa color="success" />,
      content: analysis?.recommendations?.stress
    }
  ];

  return (
    <Box sx={{ mt: 4 }}>
      <Typography variant="h4" gutterBottom sx={{ color: '#2c3e50', fontWeight: 'bold' }}>
        Medical Analysis Report
      </Typography>

      <Card sx={{ p: 3, mb: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <MedicalServices sx={{ color: '#3498db' }} />
          Patient Overview
        </Typography>
        <Typography variant="body1" component="div" sx={{ color: '#2c3e50', mt: 2 }}>
          <Box sx={{ mb: 1 }}><strong>Age:</strong> {analysis?.patient_info_used?.age || 'Not provided'}</Box>
          <Box sx={{ mb: 1 }}><strong>Gender:</strong> {analysis?.patient_info_used?.gender || 'Not provided'}</Box>
          <Box sx={{ mb: 1 }}><strong>Presenting Symptoms:</strong> {analysis?.symptoms_analyzed?.join(', ') || 'None provided'}</Box>
          <Box sx={{ mb: 1 }}><strong>Medical History:</strong> {analysis?.patient_info_used?.medical_history || 'Not provided'}</Box>
        </Typography>
      </Card>

      <Box sx={{ display: 'grid', gridTemplateColumns: { xs: '1fr', md: '1fr 1fr' }, gap: 3 }}>
        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Clinical Assessment
          </Typography>
          <List>
            {sections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemIcon sx={{ minWidth: 40 }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography 
                        variant="body2" 
                        component="div"
                        sx={{ 
                          color: '#34495e', 
                          mt: 1,
                          whiteSpace: 'pre-line'
                        }}
                      >
                        {section.content || `No ${section.title.toLowerCase()} available`}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < sections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>

        <Card sx={{ p: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
          <Typography variant="h6" gutterBottom sx={{ color: '#34495e', mb: 2 }}>
            Lifestyle Recommendations
          </Typography>
          <List>
            {lifestyleSections.map((section, index) => (
              <React.Fragment key={index}>
                <ListItem alignItems="flex-start">
                  <ListItemIcon sx={{ color: '#2ecc71', minWidth: 40 }}>
                    {section.icon}
                  </ListItemIcon>
                  <ListItemText
                    primary={
                      <Typography variant="subtitle1" sx={{ fontWeight: 'bold', color: '#2c3e50' }}>
                        {section.title}
                      </Typography>
                    }
                    secondary={
                      <Typography 
                        variant="body2" 
                        sx={{ 
                          color: '#34495e', 
                          mt: 1,
                          whiteSpace: 'pre-line'  // Preserve line breaks
                        }}
                      >
                        {section.content || `No ${section.title.toLowerCase()} available`}
                      </Typography>
                    }
                  />
                </ListItem>
                {index < lifestyleSections.length - 1 && <Divider />}
              </React.Fragment>
            ))}
          </List>
        </Card>
      </Box>

      <Card sx={{ p: 3, mt: 3, backgroundColor: '#f8f9fa', boxShadow: 3 }}>
        <Typography variant="h6" gutterBottom sx={{ color: '#34495e', display: 'flex', alignItems: 'center', gap: 1 }}>
          <Psychology sx={{ color: '#e74c3c' }} />
          Important Notes
        </Typography>
        <List>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • This is an AI-generated preliminary analysis and should not replace professional medical evaluation
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Seek immediate medical attention if symptoms worsen or new symptoms develop
                </Typography>
              }
            />
          </ListItem>
          <ListItem>
            <ListItemText
              primary={
                <Typography variant="body1" sx={{ color: '#2c3e50' }}>
                  • Regular follow-up with healthcare providers is essential
                </Typography>
              }
            />
          </ListItem>
        </List>
      </Card>
    </Box>
  );
};

export default MedicalHistoryAnalysis;
